import React from "react";
import "./style.css";
import Logo from "../../common/logo";

const Signup = () => {
  const [values, setValues] = useState([
    {
      type: "text",
      placeholder: "name"
    },
    {
      type: "text",
      placeholder: "title"
    },
    {
      type: "number",
      placeholder: "contact"
    },
    {
      type: "email",
      placeholder: "email"
    },
    {
      type: "password",
      placeholder: "password"
    },
    {
      type: "password",
      placeholder: "confirm password"
    }
  ]);

  return (
    <div className="app">
      <div className="form">
        <Logo />
        <form>
          <input className="signup-input" type="text" placeholder="name" />
        </form>
      </div>
    </div>
  );
};

export default Signup;
